// import { Link } from "react-router-dom"

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li><a href="#section-1" onClick={handleClick}>Section 1</a></li>
        <li><a href="#section-2" onClick={handleClick}>Section 2</a></li>
        <li><a href="#section-3" onClick={handleClick}>Section 3</a></li>
      </ul>
    </nav>
  )
}

export default Navbar
